import React from 'react';

const AdminDashboard: React.FC = () => {
  return (
    <div style={{ padding: 20 }}>
      <h2>Tableau de bord Administrateur</h2>
      <p>Contenu et fonctionnalités pour l’administrateur ici.</p>
    </div>
  );
};

export default AdminDashboard;
